INSERT INTO `contenidos` VALUES (1,1,1,'emg-international','EMG INTERNATIONAL','EMG INTERNATIONAL','We are a leading distributor of products as injection sensor and engine management system for Asians, Europeans and Americans vehicles. With a large experience in the market, we offer a large quantity of high quality products, which meet or exceed the original manufacturer’s specifications. Because at EMG International our customer and your satisfaction is our #1 goal.','Somos el distribuidor líder en componentes de control de inyección y gestión del motor para vehículos asiáticos, europeos y estadounidenses. Con vasta experiencia en el mercado, ofrecemos una amplia cantidad de productos de altísima calidad, diseñados y elaborados para cumplir con las más altas exigencias, que igualan o mejoran las especificaciones del fabricante original. Porque en EMG International nuestros clientes y su satisfacción es nuestra meta # 1.','emg.jpg','2016-01-23 09:37:13',1),(2,1,2,'about-us','ABOUT US','SOBRE NOSOTROS','As a leading distributor in products such as sensors of the injection and engine management system, EMG International has earned a reputation as a supplier of quality proven components, in the aftermarket that exceeds all expectations. Our years of experience in the injection and engine management business and our ability to work closely with our partners enable us to ensure that we produce a quality product at a competitive price. These products are designed and manufactured to meet your needs. Our team is working continuously in research and development to ensure we are offering our customers some of the best products in the industry. With perfect form fit and function demanded by today\'s technicians for Asians, Europeans and Americans vehicles. We ensure that our sensors can meet or exceed the original manufacturer\'s specifications at peak operating performance and provides longer life. At EMG International our customers and your satisfaction is our # 1 goal and all our staff works tirelessly to ensure that every day we are offering our customers responsible,competent and excellent service.','Como distribuidor líder en productos tales como sensores de inyección y sistemas de gestión del motor, EMG International ha ganado una reputación como proveedor de calidad en el mercado de accesorios, ofreciendo componentes comprobados y que superan todas sus expectativas. Nuestros años de experiencia en el negocio de inyección y gestión electrónica del motor y nuestra capacidad de trabajar en estrecha colaboración con nuestros socios, nos permite asegurar el poderles brindar un producto de calidad a un precio competitivo. Estos productos están diseñados y fabricados para satisfacer sus necesidades. Nuestro equipo está trabajando continuamente en investigación y desarrollo para asegurar que estamos ofreciendo a nuestros clientes los mejores productos de la industria, ofreciendo diseños cuidados a la perfección que funcionan acorde a las rigurosas exigencias de los técnicos de hoy en día para vehículos asiáticos, europeos y estadounidenses. Nos aseguramos de que nuestros sensores pueden igualar o mejorar las especificaciones del fabricante original en el desempeño operativo máximo y proporcionando una mayor vida útil. En EMG International nuestros clientes y su satisfacción es nuestra meta # 1 y todo nuestro personal trabaja sin descanso para asegurar que todos los días estamos ofreciendo a nuestros clientes un servicio responsable, competente y excelente.','about_us.jpg','2016-01-23 09:37:13',1);
/*!40000 ALTER TABLE `contenidos` ENABLE KEYS */;
